import { Card, CardContent, Typography, Box } from "@mui/material";
import ExploreIcon from "@mui/icons-material/Explore";
import { deepPurple } from "@mui/material/colors";

export default function LatLonContainer({ lat, lon }) {
  return (
    <Card
      variant="outlined"
      sx={{
        backgroundColor: deepPurple[50],
        borderRadius: 4,
        boxShadow: 3,
        width: "100%",
        my: 2,
      }}
    >
      <CardContent
        sx={{
          display: "flex",
          alignItems: "center",
          gap: 2,
          width: "100%",
          padding: 2,
          boxSizing: "border-box",
        }}
      >
        <ExploreIcon sx={{ fontSize: 50, color: deepPurple[500] }} />
        <Box>
          <Typography variant="h6" fontWeight="medium">
            Coordinates
          </Typography>
          <Typography variant="h5" fontWeight="bold">
            Lat: {lat}
          </Typography>
          <Typography variant="h6" fontWeight="medium">
            Lon: {lon}
          </Typography>
        </Box>
      </CardContent>
    </Card>
  );
}
